import './catalog.css';
import Beds from "./components/categories/beds/beds";
import Chairs from "./components/categories/chairs/chairs";
import Desks from "./components/categories/desks/desks"
import Dressers from "./components/categories/dressers/dressers";
import Cabinets from "./components/categories/cabinets/cabinets";
import Kitchens from "./components/categories/kitchens/kitchens";
import Tables from "./components/categories/tables/tables";
import { BrowserRouter, Link } from 'react-router-dom';

function Catalog () {
    return (
        <div className='Catalog'>
            <div className="left_catalog">
            <h1>Categories</h1>
            <ul>
                    <li><a href="/catalog/beds/beds.html">Beds</a></li>
                    <li><a href="/catalog/chairs/chairs.html">Chairs</a></li>
                    <li><a href="/catalog/desks/desks.html">Desks</a></li>
                    <li><a href="/catalog/dressers/dressers.html">Dressers</a></li>
                    <li><a href="/catalog/tables/tables.html">Tables</a></li>
                    <li><a href="/catalog/cabinets/cabinets.html">Cabinets</a></li>
                    <li><a href="/catalog/kitchens/kitchens.html">Kitchens</a></li>
                    <li><a href="#">Kids furniture</a></li>
                </ul>
            </div>

            <div className="catalog_default">

            <Routes>
              <Route path="/" element={<Main/>}/>
              <Route path="/catalog" element={<Catalog/>}/>
              <Route path="/about" element={<About />}/>
              <Route path="/contactus" element={<Contacts/>}/>
              <Route path="/beds" element={<Beds />}/>
              <Route path="/chairs" element={<Chairs/>}/>
              <Route path="/desks" element={<Desks/>}/>
              <Route path="/dressers" element={<Dressers/>}/>
              <Route path="/cabinets" element={<Cabinets/>}/>
              <Route path="/kitchens" element={<Kitchens/>}/>
              <Route path="/tables" element={<Tables/>}/>
            </Routes>

        </div>
        </div>
    );
}

export default Catalog;
